import React from "react";
import party from "../../icons/party.png";


export default () => (
    <span style={{
        backgroundImage: "url( " + party + ")",
        backgroundSize: "contain",
        height: "100%",
        backgroundPosition: "center",
        width: "100%",
        backgroundRepeat: "no-repeat"
    }}>&nbsp; &nbsp; &nbsp;</span>
)
